function Persons({ persons }) {
  return (
    <ul>
      {persons.map((person) => (
        <li key={person.id}>
          <div
            style={{ display: "flex", flexDirection: "row", marginBlock: 8 }}
          >
            <p>
              {person.name} {person.number}
            </p>
            <button style={{ marginInline: 16 }}>delete</button>
          </div>
        </li>
      ))}
    </ul>
  );
}

export default Persons;
